using System;
using System.Collections;
using System.Collections.Generic;
using System.Runtime.InteropServices;
using UnityEngine;
using UnityEngine.XR;

namespace Unity.XR.OpenVR
{
	public static class OpenVR
	{
		private static readonly List<XRInputSubsystem> s_InputSubsystemInstances = new List<XRInputSubsystem>();

		private const string k_SubsystemName = "OpenVR Input";

		public static bool Initialize()
		{
			bool success = InitializeInternal();

			if (success)
			{
				s_InputSubsystemInstances.Clear();
				XRInputSubsystem inputSubsystem = Subsystem<XRInputSubsystem>();
				if (inputSubsystem!= null)
				{
					s_InputSubsystemInstances.Add(inputSubsystem);
				}
			}

			return success;
		}

		private static bool InitializeInternal()
		{
			bool success = false;
			List<XRDisplaySubsystem> displaySubsystems = new List<XRDisplaySubsystem>();
			SubsystemUtils.GetInstances(displaySubsystems);
			foreach (XRDisplaySubsystem display in displaySubsystems)
			{
				if (display.running)
				{
					success = display.TryGetFeatureValue(typeof(OpenVRDisplay), out OpenVRDisplay openVRDisplay);
					if (success)
					{
						openVRDisplay.Initialize();
						break;
					}
				}
			}
			return success;
		}

		public static XRInputSubsystem Subsystem()
		{
			XRInputSubsystem inputSubsystem = null;
			foreach (XRInputSubsystem instance in s_InputSubsystemInstances)
			{
				if (instance.running)
				{
					inputSubsystem = instance;
					break;
				}
			}
			return inputSubsystem;
		}

		public static T Subsystem<T>() where T : XRInputSubsystem
		{
			return Subsystem() as T;
		}
	}

	[DefaultExecutionOrder(1000)]
	public class OpenVRInput : XRInputSubsystem
	{
		[RuntimeInitializeOnLoadMethod(RuntimeInitializeLoadType.BeforeSceneLoad)]
		private static void Load()
		{
			XRInputSubsystem.Register(OpenVR.k_SubsystemName, typeof(OpenVRInput));
		}

		protected override void Start()
		{
			base.Start();
			OpenVR.Initialize();
		}

		protected override void OnStop()
		{
			base.OnStop();
			OpenVR.Subsystem<OpenVRInput>().Destroy();
		}
	}

